import React from "react";

const Format = () => {
  return (
    <div>
      <form>
        <div>
          {" "}
          Tittle
          <input type="text" placeholder="Enter your Tittle"></input>
        </div>
        <label htmlFor="">FirstName</label>
        <input type="text" placeholder="Enter your Firstname"></input>
        <label htmlFor="">LasttName</label>
        <input type="text" placeholder="Enter your Lastname"></input>
        <label htmlFor="">MiddletName</label>
        <input type="text" placeholder="Enter your Middlename"></input>
        <label htmlFor="">Gender</label>
        <input type="text" placeholder="Enter your Gender"></input>
        <label htmlFor="">Marital Status</label>
        <input type="text" placeholder="Enter your MeitalStatus"></input>
        <label htmlFor="">Religion</label>
        <input type="text" placeholder="Enter your Religion"></input>
        <label htmlFor="">Date of Birth</label>
        <input type="text" placeholder="Enter your DOB"></input>
      </form>
    </div>
  );
};

export default Format;
